import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './styles/App.css';
import './styles/Questions.css'
import Header from './components/header';
import QuestionList from './components/questionList';
import QuestionComents from './components/coments';
import ExibirMeusQuestions from './components/exibirMeusQuestions';


function App() {
  return (
    <div className="App">
      <header className="header">
        <Header username={"Alan Pires"} />
      </header>
      <main>
        <Router>
          <Routes>
              <Route path="/" element={<QuestionList />} />
              <Route path="/questions/:id" element={<QuestionComents />} />
              <Route path="/myquestions/:id" element={<ExibirMeusQuestions />} />
          </Routes>
        </Router>
      </main>
      <footer>

      </footer>
    </div>
  );
}

export default App;
